import { FirstName, LastName } from "./App";

const ComC = () =>{
    return(
        <>
        <FirstName.Consumer> 
           {(fname)=> {
              return(
                  <LastName.Consumer>
                  {() =>{
                      return(
                        <>
                        <h1>hello world {fname}</h1>
                        </>
                      )
                  }}

                  </LastName.Consumer>

            );
        }}

        </FirstName.Consumer>
        </>
    )
}
export default ComC;
